            background-position: center;
            animation: subtleZoom 30s ease-in-out infinite;
        }

        @keyframes subtleZoom {
            0%, 100% { transform: scale(1); }
            50% { transform: scale(1.05); }
        }

        .content {
            position: absolute;
            width: 100%;
            height: 100%;
            display: flex;
            flex-direction: column;
            justify-content: center;
            align-items: center;
            text-align: center;
        }

        .main-title {
            font-family: 'Cinzel Decorative', serif;
            font-size: 85px;
            font-weight: 900;
            color: #fff;
            letter-spacing: 12px;
            text-transform: uppercase;
            margin-bottom: 35px;
            text-shadow: 
                0 0 30px rgba(212,175,55,1),
                0 0 60px rgba(212,175,55,0.7),
                0 0 90px rgba(212,175,55,0.4),
                0 10px 50px rgba(0,0,0,1),
                0 15px 70px rgba(0,0,0,0.9),
                0 5px 25px rgba(0,0,0,1);
            animation: titleGlow 3s ease-in-out infinite, fadeInDown 1.2s ease-out;
        }

        @keyframes titleGlow {
            0%, 100% { 
                text-shadow: 
                    0 0 30px rgba(212,175,55,1),
                    0 0 60px rgba(212,175,55,0.7),
                    0 0 90px rgba(212,175,55,0.4),
                    0 10px 50px rgba(0,0,0,1);
            }
            50% { 
                text-shadow: 
                    0 0 45px rgba(212,175,55,1),
                    0 0 80px rgba(212,175,55,0.9),
                    0 0 120px rgba(212,175,55,0.6),
                    0 10px 50px rgba(0,0,0,1);
            }
        }

        @keyframes fadeInDown {
            from {
                opacity: 0;
                transform: translateY(-50px);
            }
            to {
                opacity: 1;
                transform: translateY(0);
            }
        }

        .subtitle {
            font-family: 'Cinzel', serif;
            font-size: 40px;
            font-weight: 600;
            color: #d4af37;
            letter-spacing: 8px;
            margin-bottom: 55px;
            text-shadow: 
                0 0 25px rgba(212,175,55,0.8),
                0 8px 35px rgba(0,0,0,1),
                0 12px 50px rgba(0,0,0,0.9),
                0 4px 18px rgba(0,0,0,1);
            animation: fadeIn 1.5s ease-out 0.3s backwards;
        }

        @keyframes fadeIn {
            from { opacity: 0; }
            to { opacity: 1; }
        }

        .timer-section {
            display: flex;
            flex-direction: column;
            align-items: center;
            gap: 25px;
            position: relative;
            animation: scaleIn 1s ease-out 0.6s backwards;
        }

        @keyframes scaleIn {
            from {
                opacity: 0;
                transform: scale(0.8);
            }
            to {
                opacity: 1;
                transform: scale(1);
            }
        }

        .timer-label {
            font-family: 'Cinzel', serif;
            font-size: 36px;
            font-weight: 600;
            color: #c9c9c9;
            letter-spacing: 8px;
            text-transform: uppercase;
            text-shadow: 
                0 6px 25px rgba(0,0,0,1),
                0 10px 40px rgba(0,0,0,0.9),
                0 3px 12px rgba(0,0,0,1);
            animation: pulse 2s ease-in-out infinite;
        }

        @keyframes pulse {
            0%, 100% { opacity: 1; }
            50% { opacity: 0.7; }
        }

        .timer-box {
            background: rgba(15, 10, 5, 0.85);
            border: 4px solid #d4af37;
            border-radius: 15px;
            padding: 55px 130px;
            box-shadow: 
                0 0 40px rgba(212,175,55,0.7),
                inset 0 0 40px rgba(0,0,0,0.7),
                0 12px 60px rgba(0,0,0,1),
                0 18px 80px rgba(0,0,0,0.8),
                inset 0 2px 0 rgba(212,175,55,0.3);
            backdrop-filter: blur(10px);
            min-width: 480px;
            min-height: 160px;
            display: flex;
            align-items: center;
            justify-content: center;
            position: relative;
            animation: boxGlow 4s ease-in-out infinite;
        }

        @keyframes boxGlow {
            0%, 100% { 
                box-shadow: 
                    0 0 40px rgba(212,175,55,0.7),
                    inset 0 0 40px rgba(0,0,0,0.7),
                    0 12px 60px rgba(0,0,0,1);
            }
            50% { 
                box-shadow: 
                    0 0 60px rgba(212,175,55,1),
                    inset 0 0 40px rgba(0,0,0,0.7),
                    0 12px 60px rgba(0,0,0,1);
            }
        }

        .timer-box::before {
            content: '';
            position: absolute;
            top: -4px;
            left: -4px;
            right: -4px;
            bottom: -4px;
            border: 2px solid rgba(212,175,55,0.3);
            border-radius: 15px;
            pointer-events: none;
            animation: borderPulse 3s ease-in-out infinite;
        }

        @keyframes borderPulse {
            0%, 100% { opacity: 0.3; }
            50% { opacity: 0.7; }
        }

        .bottom-text {
            position: absolute;
            bottom: 70px;
            width: 100%;
            text-align: center;
            font-family: 'Cinzel', serif;
            font-size: 34px;
            font-weight: 600;
            color: #e8e8e8;
            letter-spacing: 4px;
            text-shadow: 
                0 8px 30px rgba(0,0,0,1),
                0 12px 45px rgba(0,0,0,1),
                0 16px 60px rgba(0,0,0,0.9),
                0 20px 75px rgba(0,0,0,0.8),
                0 4px 15px rgba(0,0,0,1),
                0 2px 10px rgba(0,0,0,1);
            animation: fadeInUp 1.8s ease-out 0.9s backwards;
        }

        @keyframes fadeInUp {
            from {
                opacity: 0;
                transform: translateY(30px);
            }
            to {
                opacity: 1;
                transform: translateY(0);
            }
        }

        .highlight {
            color: #d4af37;
            font-weight: 700;
            text-shadow: 
                0 0 25px rgba(212,175,55,0.7),
                0 8px 30px rgba(0,0,0,1),
                0 12px 45px rgba(0,0,0,1),
                0 16px 60px rgba(0,0,0,0.9),
                0 20px 75px rgba(0,0,0,0.8),
                0 4px 15px rgba(0,0,0,1);
            animation: highlightGlow 2.5s ease-in-out infinite;
        }

        @keyframes highlightGlow {
            0%, 100% { 
                text-shadow: 
                    0 0 25px rgba(212,175,55,0.7),
                    0 8px 30px rgba(0,0,0,1);
            }
            50% { 
                text-shadow: 
                    0 0 40px rgba(212,175,55,1),
                    0 8px 30px rgba(0,0,0,1);
            }
        }

        /* Floating particles effect */
        .particle {
            position: absolute;
            width: 3px;
            height: 3px;
            background: rgba(212,175,55,0.6);
            border-radius: 50%;
            pointer-events: none;
            animation: float 15s linear infinite;
        }

        @keyframes float {
            0% {
                transform: translateY(1080px) translateX(0);
                opacity: 0;
            }
            10% {
                opacity: 1;
            }
            90% {
                opacity: 1;
            }
            100% {
                transform: translateY(-100px) translateX(100px);
                opacity: 0;
            }
        }
    </style>
</head>
<body>
    <div class="container">
        <!-- Floating particles -->
        <div class="particle" style="left: 10%; animation-delay: 0s; animation-duration: 12s;"></div>
        <div class="particle" style="left: 25%; animation-delay: 3s; animation-duration: 15s;"></div>
        <div class="particle" style="left: 40%; animation-delay: 6s; animation-duration: 18s;"></div>
        <div class="particle" style="left: 60%; animation-delay: 2s; animation-duration: 14s;"></div>
        <div class="particle" style="left: 75%; animation-delay: 5s; animation-duration: 16s;"></div>
        <div class="particle" style="left: 90%; animation-delay: 8s; animation-duration: 13s;"></div>
        
        <div class="content">
            <div class="main-title">STREAM STARTET</div>
            <div class="subtitle">Thinnurusg Graustein</div>
            
            <div class="timer-section">
                <div class="timer-label">IN KRZE</div>
                <div class="timer-box">
                    <!-- Timer via OBS Text-Quelle -->
                </div>
            </div>
        </div>

        <div class="bottom-text">
            Der Wolf erwacht  <span class="highlight">Bereite dich vor</span>
        </div>
    </div>

    <script>
        // Add more dynamic particles
        const container = document.querySelector('.container');
        for(let i = 0; i < 15; i++) {
            const particle = document.createElement('div');
            particle.className = 'particle';
            particle.style.left = Math.random() * 100 + '%';
            particle.style.animationDelay = Math.random() * 10 + 's';
            particle.style.animationDuration = (12 + Math.random() * 8) + 's';
            container.appendChild(particle);
        }
    </script>
</body>
</html>
